    data: |
      SELECT ALL - 70 FROM tab0 WHERE - + col0 > - 12 * + col2 * col0 + - col2 * ( - col0 ) * + col2 / + col0;
  - name: tab0

outputs:
  - name: q9816.out
    data: |
      -70
      -70
      -70
